import React from 'react';
import { 
  Box, 
  Typography, 
  Chip,
  Divider 
} from '@mui/material';

function LaunchDetail({ launch }) {
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        {launch.name}
      </Typography>

      <Chip 
        label={launch.success ? 'Success' : 'Failed'} 
        color={launch.success ? 'success' : 'error'} 
        sx={{ mb: 2 }}
      />

      <Typography variant="subtitle1" gutterBottom>
        Launch Date: {new Date(launch.date_utc).toLocaleString()}
      </Typography>

      <Divider sx={{ my: 2 }} />

      <Typography variant="body1" paragraph>
        {launch.details || 'No details available'}
      </Typography>

      {launch.links?.webcast && (
        <Box sx={{ mt: 2 }}>
          <Typography variant="h6" gutterBottom>
            Watch Launch
          </Typography>
          <iframe
            width="100%"
            height="315"
            src={`https://www.youtube.com/embed/${launch.links.webcast.split('v=')[1]}`}
            title="Launch Video"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
          />
        </Box>
      )}
    </Box>
  );
}

export default LaunchDetail;
